import { useState } from 'react';

function SignupForm() {

  const [state, setState] = useState({name: name, email: email, password: password})
  const handleChange = (e) => {
    this.setState({name: e.tar})
  }

  return (
    <div>
      <form>
        <input id="name" type="text" name="name" placeholder="ユーザー名" value={this.state.name} onChange={handleChange} />
        <input id="email" type="email" name="email" placeholder="メールアドレス" />
        <input id="password" type="password" name="password" placeholder="パスワード" />
        <input type="submit" value="新規登録" />
      </form>
    </div>
  );
}

export default SignupForm
